parameters.inputSchema:
{
  "$schema": "http://json-schema.org/draft-07/schema#",
  "title": "Invoice",
  "type": "object",
  "properties": {
    "invoiceId": {
      "type": "string",
      "description": "Unique invoice identifier"
    },
    "invoiceNumber": {
      "type": "string",
      "description": "Human-readable invoice number (e.g. INV-2025-001)"
    },
    "invoiceDate": {
      "type": "string",
      "format": "date",
      "description": "Invoice issue date"
    },
    "dueDate": {
      "type": "string",
      "format": "date",
      "description": "Payment due date"
    },
    "company": {
      "type": "object",
      "properties": {
        "name": { "type": "string" },
        "address": { "type": "string" },
        "email": { "type": "string" },
        "phone": { "type": "string" },
        "taxId": { "type": "string" }
      },
      "required": ["name"]
    },
    "client": {
      "type": "object",
      "properties": {
        "name": { "type": "string" },
        "address": { "type": "string" },
        "email": { "type": "string" },
        "phone": { "type": "string" }
      },
      "required": ["name"]
    },
    "items": {
      "type": "array",
      "description": "Line items billed on the invoice",
      "items": {
        "type": "object",
        "properties": {
          "description": { "type": "string" },
          "quantity": { "type": "number" },
          "unitPrice": { "type": "number" },
          "total": { "type": "number" },
          "taxRate": { "type": "number" }
        },
        "required": ["description", "quantity", "unitPrice"]
      }
    },
    "subTotal": {
      "type": "number",
      "description": "Total before tax and discounts"
    },
    "taxAmount": {
      "type": "number",
      "description": "Total tax amount applied"
    },
    "discount": {
      "type": "number",
      "description": "Discount applied to invoice"
    },
    "totalAmount": {
      "type": "number",
      "description": "Final amount due"
    },
    "currency": {
      "type": "string",
      "description": "Currency code (e.g. USD, EUR, INR)"
    },
    "notes": {
      "type": "string",
      "description": "Optional notes or terms"
    },
    "payment": {
      "type": "object",
      "properties": {
        "method": { "type": "string", "description": "Payment method (Bank, Card, etc.)" },
        "status": { "type": "string", "description": "paid, pending, overdue" },
        "transactionId": { "type": "string" },
        "paymentDate": { "type": "string", "format": "date" }
      }
    },
    "attachments": {
      "type": "array",
      "description": "Links to attached invoice PDFs or receipts",
      "items": {
        "type": "string",
        "format": "uri"
      }
    }
  }
}

